import {  BrowserRouter,  Route,  Routes} from 'react-router-dom';
import Notes from './Notes'

function App() {
  return (
    <div className = "App" >
    <BrowserRouter>
    <Routes>
    <Route path = "/notes">
    <Notes/>
    </Route>
    <Route path = "/login">
    <Login/>
    </Route>
    </Routes>
    </BrowserRouter>
    </div>
  )
}

export default App
